  subscription1.unsubscribe();
  button.setChecked(true);
  inOrder1.verify(observer1,never()).onNext(anyBoolean());
  inOrder2.verify(observer2,times(1)).onNext(true);
  subscription2.unsubscribe();
  button.setChecked(false);
  inOrder1.verify(observer1,never()).onNext(anyBoolean());
